import Head from "next/head";
import Layout from "../component/Layout";

const Favorite = () => {
  return (
    <div>
      <Head>
        <title>Favorite</title>
      </Head>
      <h1>Hello Favorite</h1>
    </div>
  );
};

export default Favorite;
